login.sol.content:
// SPDX-License-Identifier: MIT;
pragma solidity ^0.8.7;

contract UserReg {
    struct User {
        uint id;
        string name;
        string password;
    }

    User[] userList;
    uint count = 0;

    function reg (string memory _name,string memory _password) public payable {
        count++;
        userList.push(User({id:count,name:_name,password:_password}));
    }

    function getUserList() public view returns (User[] memory){
        return userList;
    }
}

contract Login {
    UserReg u;
    function reg(string memory _name,string memory _password) public {
        u.reg(_name,_password);
    }

    function getUserList() public view {
        u.getUserList();
    }
}

